import './App.css';

function Paintings() {
    return (
      <div className="Paintings">
          <p>
            In my free time, I enjoy putting big colorful smears on canvases 
            (particularly, oil painting). Here are a few of my selected works. If 
            applicable, please direct any painting-related inquiries to my 
            personal email myradotzel[at]gmail[dot]com.
          </p>  
      </div>
    );
  }
  
  export default Paintings;
